from typing import List

class Solution:
    def nearestExit(self, maze: List[List[str]], entrance: List[int]) -> int:
        n, m = len(maze), len(maze[0])
        a, b = entrance
        maze[a][b] = 0

        steps = float('inf')
        stack = [entrance]
        while stack:
            a, b = stack[0]
            t = maze[a][b] + 1
            if a-1 >= 0 and maze[a-1][b] == '.':
                maze[a-1][b] = t
                stack.append([a-1, b])
                if a-1 == 0 or b in (0, m-1):
                    steps = min(t, steps)

            if a+1 < n and maze[a+1][b] == '.':
                maze[a+1][b] = t
                stack.append([a+1, b])
                if a+1 == n-1 or b in (0, m-1):
                    steps = min(t, steps)

            if b-1 >= 0 and maze[a][b-1] == '.':
                maze[a][b-1] = t
                stack.append([a, b-1])
                if b-1 == 0 or a in (0, n-1):
                    steps = min(t, steps)

            if b+1 < m and maze[a][b+1] == '.':
                maze[a][b+1] = t
                stack.append([a, b+1])
                if b+1 == m-1 or a in (0, n-1):
                    steps = min(t, steps)

            stack = stack[1:]

        return -1 if steps == float('inf') else steps


